import React from 'react';

function Station(props) {
  return (
    <div className="link">
        <svg height="50" width="50">
            <circle cx="25" cy="25" r="5" stroke="black" stroke-width="3" fill="black" />
        </svg>
    </div>
  );
}

export default Link;
